import img_logo from "../img/logo.png"
import { Link } from "react-scroll"

export default function Navbar(){
    return(
        <nav className="navbar navbar-expand-md navbar-light">
          <div className="container-fluid">
          <img className="p-2" src={img_logo} style={{width:"100px",height:"50px"}} />
            <a className="navbar-brand" href="#">HLY Spices</a>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
              <div className="navbar-nav">
                <a className="nav-link active" aria-current="page" href="#">Acceuil</a>
                <a className="nav-link" href="#">Nos produits</a>
                <Link to="product-group"
                    activeClass="active"
                    spy={true}
                    smooth={true}
                    offset={0}
                    duration={500}> <a className="nav-link" href="#">Nos produits</a> </Link>

                <Link to="contact-form"
                    activeClass="active"
                    spy={true}
                    smooth={true}
                    offset={0}
                    duration={500}> <a className="nav-link" href="#">Contact</a> </Link>
                
              </div>
            </div>
          </div>
        </nav>
    )
}
